import React from 'react'
import { useNavigate } from 'react-router-dom'
export default function Header() {
  const navigator = useNavigate()
  return (
    <div onClick={()=>{navigator('/dashboard')}} style={{ height: '60px', lineHeight: '60px', paddingRight: '30px', background: '#333', textAlign: 'right', color: '#fff' }}>Header</div>
  )
}
